Course.create([
  { :title => "免費課程", :description => "<div class=\"content-top\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; font-size: 16px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Helvetica, 'LiHei Pro', PMingLiU, sans-serif; line-height: 16px;\">\r\n<div class=\"ad-banner\" style=\"margin: 10px 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent;\">\r\n<div class=\"advertise advertising\" id=\"adv-81\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; width: 590px; height: 60px;\">\r\n<div class=\"advertise-item\" id=\"advertise_2964\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-color: transparent; position: relative; width: 590px; height: 60px;\">\r\n<div style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; position: absolute; left: 0px; top: 0px; z-index: 1; cursor: pointer; width: 590px; height: 60px; opacity: 0;\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p><img alt=\"0e76278f6c5e3acd4ea14b49c22cf7fd\" src=\"http://cdn0.techbang.com.tw/system/excerpt_images/13566/inpage/0e76278f6c5e3acd4ea14b49c22cf7fd.jpg?1370408914\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); float:left; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline\" />雖然 Computex Sony 沒有參展，不過這次也在同時段推出了全新的 VAIO 筆電，除了觸控平板的 Duo 13 之外，VAIO Pro 更是帶來了全新的超輕薄旗艦機種的改版，11 吋的 VAIO Pro 11 僅 0.87 公斤，VAIO Pro 13 也只有 1.060 公斤，是目前世界最輕的 13 吋觸控筆電。</p>\r\n\r\n<h2>VAIO Z 接班人，VAIO Pro 上埸打擊</h2>\r\n\r\n<p>雖然世界最輕的 13 吋筆電已經有 870 公克的&nbsp;NEC LaVie Z，不過 VAIO Pro 13 則是打著世界最輕的「觸控」筆電。VAIO 也和過去採用了完全不同的命名方式，過去字母命名的規則已經不在，取代的是滑蓋的 Duo，旗艦機種 Pro，平價的 Fit、Fit E，桌上型的 Tap。</p>\r\n\r\n<p>VAIO Pro 很明顯就是要取代過去 VAIO Z、S 的位置，主打的是高階的 13 吋主流筆電，同時讓價格不會像過去 VAIO Z 這麼高，相對比較親民。VAIO Pro 13/11 這次主打的就是重量，13 吋只有 1.060 公斤，11 吋更是只有 0.87&nbsp;公斤，在這輕巧的重量之下還同時配備了 1920 x 1080 解析度的觸控螢幕，也是目前沒有筆電能達到的。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn3.techbang.com.tw/system/images/123654/original/fb4bb92cf49fb5b5c3dfbeab90dd7794.jpg?1370408983\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲13 觸控螢幕，解析度為 1920 x 1080。</p>\r\n\r\n<p>新的 VAIO Pro 很可惜的沒有加入了&nbsp;WQHD（2560 x 1440）解析度的螢幕，主要還是針對色彩的部分做了比較多的加強，使用了 TRILUMINOS Display for mobile 技術，讓筆電也能有 BRAVIA 電視的色彩，解析度技術則是使用 X-Reality for mobile，依然維持在 1920 x 1080。詢問了 PM 有關超高解析度的消息，只得到了今年都沒有相關的計劃，因此短期也不會在 VAIO 筆電身上看到超高解析度的筆電。</p>\r\n\r\n<p>VAIO Pro 搭載的處理器當然也是 Haswell Core i5 或是 Core i7，不過目前最終上市的規格都還沒出來，所以還不能確定。台灣沒有非常明確的上市日期，大約在六月中或底有可能會看到 VAIO Pro 出現在賣埸上。</p>\r\n\r\n<p>價格雖然還沒有台灣售價，不過 VAIO Pro 11 美國由&nbsp;1,150 美元（約新台幣 34,316元）起跳，VAIO Pro 13 由 1,250 美元（約新台幣37,300元）起跳。VAIO Pro 之所以價格如此便宜也有部分原因是不像 VAIO Duo 13 是日本製造，也沒有完全接下 VAIO Z 極致龜毛的元素，VAIO Pro 會是中國製造。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn3.techbang.com.tw/system/images/123655/original/1fbbd716942ecc2d621d37d99029bbe2.jpg?1370408983\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲機身背面採用了金屬質感材質設計。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn1.techbang.com.tw/system/images/123669/original/cbdd0898beef01473f82601cf2d7b2ad.jpg?1370408992\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲底部的設計非常簡潔，中間還有擴充電池用的連接埠。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn0.techbang.com.tw/system/images/123665/original/c3232847f8eddccf299c2428bcaa47e2.jpg?1370408991\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲VAIO Pro 11 底部的設計和 13 非常相似。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn2.techbang.com.tw/system/images/123680/original/3ae27705855ad0906ed8f5ce18618a20.jpg?1370408998\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲機身採用碳纖維打造，鍵盤支援背光，使用獨立式設計。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn1.techbang.com.tw/system/images/123683/original/0508b322efab7fbf917f89ae2141f7e7.jpg?1370408998\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲電源鍵在機身的右上角，右側還可以看到有電源燈。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn2.techbang.com.tw/system/images/123686/original/2c4eaeced8d1c5fedfc63c9b45ea028d.jpg?1370408999\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲觸控板採用單片式的設計，手腕放置處使用金屬拉絲的設計風格。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn1.techbang.com.tw/system/images/123662/original/ffed5bf4c86d5382e7a09f92a94c7bb2.jpg?1370408990\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲連接埠都只有右側才有，13 吋多了讀卡機，兩台都有音源孔、USB 3.0 x 2、HDMI。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn2.techbang.com.tw/system/images/123659/original/b8cd193cce33a28483931758e74016fd.jpg?1370408987\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲左為 VAIO Pro 13，右為 VAIO Pro 11。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn0.techbang.com.tw/system/images/123656/original/82fc26cbb571f6e507e7ee65cb95262e.jpg?1370408984\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲機身的左側只有電源孔和散熱孔，沒有其他的連接埠。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn2.techbang.com.tw/system/images/123671/original/921cb850acbe3862ea2915ac922c88cd.jpg?1370408994\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲由側面也可以感受出 VAIO Pro 的輕薄度。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn3.techbang.com.tw/system/images/123658/original/171d486c1b44db5ae94267f8504d2f51.jpg?1370408986\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲除了銀白色的版本，當然也有黑色的板本。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn3.techbang.com.tw/system/images/123657/original/66abb0de188b061ab17860b3947eef6f.jpg?1370408986\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲VAIO Pro 11 接上了擴充電池，底部會再往上墊高一些角度。</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://cdn1.techbang.com.tw/system/images/123660/original/b5a69fdb7b3a0712b443989e00068461.jpg?1370408989\" style=\"background-color:transparent; border:1px solid rgb(238, 238, 238); height:427px; margin:0px 10px 0px 0px; outline:0px; padding:2px; vertical-align:baseline; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\">▲只有 1 公斤上下的 VAIO Pro 13，就算是單手也可以輕鬆拿起，行動力增加了不少分數。</p>\r\n", :briefing => "課程簡介", :start_at => "2013-05-31 16:00:00", :end_at => "2031-01-31 16:00:00", :due_at => "2031-01-31 16:00:00", :price => 0.0, :duration_days => 28, :group_id => 1, :category_id => 1, :created_at => "2013-06-06 03:33:53", :updated_at => "2013-06-06 10:03:28", :unit => "Unit 0", :serial => "C01U00" },
